let url = '/api/v1/sap/benefits/get_dental'
let token = $(this).attr("token")
let code = $(this).attr("code")
let cdt_data  = {benefit: code, with_cdt: true}

class BenefitDental extends React.Component {
   constructor(props) {
    super(props);
    this.state = {
      benefitdata: []
    }
    this.componentDidMount = this.componentDidMount.bind(this);
  }
  componentDidMount(){
   axios({
          method: 'post',
          url: url,
          headers: { 'Authorization': `Bearer ${token}` },
          data: cdt_data
        })
        .then(response => {
         let res = response.data
        this.setState({benefitdata: res})
        })
        .catch(function (error) {
          // window.document.location = `/web`
          // alertify.error(`<i class="close icon"></i>${error.response.data.error.message}`)
        })
        .then(function(response) {
          $('.ui.dropdown').dropdown()
        })

  }
  render() {
   return(<div id="view_benefit_dental">
     <HeaderDental newVal={this.state.benefitdata} />
     <Container newVal={this.state.benefitdata} />
   </div>
  )
 }
}

class Container extends React.Component {
   constructor(props) {
    super(props);
  }
 render(){
    return(
  <div id="ui container">
    <div className="content-section white-bg">
        <div className="ui grid">
          <div className="row">
             <BenefitType newVal={this.props.newVal}/>
             <BenefitDetails newVal={this.props.newVal}/>
             <BenefitOptions />
             <BenefitDetails2 newVal={this.props.newVal} />
          </div>
        </div>
    </div>
  </div>
  )
 }
}

class BenefitType extends React.Component {
 render(){
    return(
       <div className="two wide computer sixteen wide mobile column">
          <div className="mb-2 center aligned">
