                <label>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Riders</label>
          </div>
       </div>
  )
 }
}

class BenefitDetails extends React.Component {
 render(){
     let benefitName = $('#benefit-code').attr('val')
     let color = {color: '#00B24F'}
     let values = this.props.newVal
    return(
     <div className="six wide computer eight wide tablet eight wide mobile column">
       <p className="member-name" style={color}>{values.code}</p>
       <div className="section-title mt-2">
        <h1>
          <div className="title-name">{values.name}</div>
        </h1>
       </div>
     </div>
  )
 }
}

class BenefitOptions extends React.Component {
 render(){
     let styles = {textAlign: 'right', fontSize: '2rem', paddingTop: '1rem'}
   return(
            <div className="eight wide computer eight wide tablet eight wide mobile column">
              <div className="two wide computer sixteen wide mobile column" style={styles}>
                <div className="ui dropdown">
                  <i className="ellipsis vertical icon"></i>
                  <div className="menu">
                    <div className="item">
                      <i className="edit outline icon"></i>
                      Edit
                    </div>
                    <div className="item">
                      <i className="clone outline icon"></i>
                      Versions
                    </div>
                    <div className="item">
                      <i className="icon-product icon"></i>
                      View plans
                    </div>
                    <div className="divider"></div>
                    <div className="item">
                      <i className="trash alternate icon"></i>
                      Discontinue
                    </div>
                    <div className="item">
                      <i className="trash alternate icon"></i>
                      Delete
                    </div>
                  </div>
                </div>
              </div>
            </div>
  )
 }
}

class BenefitDetails2 extends React.Component {
   constructor(props) {
    super(props);
  }
 render(){
   let styles = {height: "9px"}
   let benefitValues = this.props.newVal
   // console.log(benefitValues)
